import React from "react";
import "./style.css";

function Navbar(){
    return(
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
            <li className="navbar-item" href="/">
            Employee Directory
            </li>
        </nav>
        );
    }

export default Navbar;
